import './Tables.scss';
import schedule from '../../../data/Schedule.json';

export const Tables = () => {
  const timeArr = ["9:00", "10:00", "11:00", "12:00", "13:00", "14:00", "15:00", "16:00","17:00", "18:00", "19:00", "20:00"];

  return (
    <div className="tables">
      <table>
        <thead>
          <tr>
            <th>Day</th>
          </tr>
        </thead>
        <tbody>
          {schedule.map((user) => (
            <tr key={user.id}>
              <td>{user.day}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <table>
        <thead>
          <tr>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {timeArr.map((time, index) => (
            <tr key={index}>
              <td>{time}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <table>
        <tbody>
          {schedule.map((user) => (
            <tr key={user.id}>
              <td>{user.day}</td>
              {Object.keys(user.plan).map((plan, index) => (
                <tr key={index}>
                  <td>{plan}</td>
                  <td className="tables--border">{user.plan[plan]}</td>
                </tr>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
